import ReactDOM from 'react-dom/client';
import { BrowserRouter } from 'react-router-dom';
import Appp from './App';


import App from './App'


import './index.css';


const rootElem = document.getElementById('root')

if (rootElem) {
  const root = ReactDOM.createRoot(rootElem);
  root.render(
    <BrowserRouter>
      <React.StrictMode>
        <App />
        <Appp/>
      </React.StrictMode>
    </BrowserRouter>
  );
}
